import React from 'react';

export default class TopNav extends React.Component {
    render() {
        return (
            <div className="topnav">
                <a href="/home">Home</a>
                <a href="/students">Students</a>
                <a href="/colleges">Colleges</a>
                <a href="/about">About</a>
            </div>
        )
    }
}
